column8:
北米オートテクニック社のBMW Fモデル専用のサイドブレーキ・ハンドルです。美しいカーボンと、手触りの良いアルカンターラのコンビネーション。見た目だけではなく、機能的にも優れる一品です。<br>右ハンドル車、左ハンドル車、共通のパーツです。<br><br>
■ ABS樹脂ベース、リアルカーボン、アルカンターラ仕上げ<br>
■ 純正パーツ交換タイプです。<br>
■ 対応車種：F20 1-Series, 
F20 1-Series LCI, 
F21 1-Series, 
F21 1-Series LCI, <br>
F22 2-Series, 
F23 2-Series, <br>
F30 3-Series, 
F30 3-Series LCI, 
F31 3-Series, 
F31 3-Series LCI, 
F34 3-Series GT, <br>
F32 4-Series, 
F33 4-Series, 
F36 4-Series<br><h2>CARBON FIBER DESIGNS</h2>
